         * If the current character is a digit,
         * convert it into integer and store it
         * in num1.
         */
        if(str[i] >= '0' && str[i] <= '9')
        {
            num1 = str[i] - '0';
            break;
        }
    }

    /*
     * Iterates through the string and
     * finds the second number and operator.
     */
    for(i=i+1; i<len; i++)
    {
        /*
         * If the current character is a digit,
         * convert it into integer and store it
         * in num2.
         */
        if(str[i] >= '0' && str[i] <= '9')
        {
            num2 = str[i] - '0';
            break;
        }
    }

    /*
     * Iterates through the string and
     * finds the operator.
     */
    for(i=i+1; i<len; i++)
    {
        /*
         * If the current character is an operator,
         * store it in op.
         */
        if(str[i] == '+' || str[i] == '-' ||
           str[i] == '*' || str[i] == '/' ||
           str[i] == '%' || str[i] == '^')
        {
            op = str[i];
            break;
        }
    }

    /*
     * Calculates the result based on the operator.
     */
    switch(op)
    {
        case '+':
            result = num1 + num2;
            break;

        case '-':
            result = num1 - num2;
            break;

        case '*':
            result = num1 * num2;
            break;

        case '/':
            result = num1 / num2;
            break;

        case '%':
            result = num1 % num2;
            break;

        case '^':
            result = pow(num1, num2);
            break;

        default:
            printf("Invalid operator");
            break;
    }

    /*
     * Prints the result.
     */
    printf("The answer is  %d", result);

    return 0;
}

