    int maxPathSumHelper(TreeNode* root, int &maxSum) {
        if(root == nullptr) {
            return 0;
        }

        int left = maxPathSumHelper(root->left, maxSum);
        int right = maxPathSumHelper(root->right, maxSum);

        int currSum = root->val;
        if(left > 0) {
            currSum += left;
        }
